additional_info:
Important!!!

If used with the style "YouTube - Custom colors video progress bar," DELETE the code below from the "Custom colors video progress bar" style (found at the very top under /* scrubber button */). This overrides the background color on the horse during hover. If not deleted, when scrubbing, the horse will be covered by a solid color. Looking for a workaround.

.html5-scrubber-button:hover, .ytp-scrubber-button:hover, .ytp-swatch-background-color, .ytp-swatch-background-color-secondary {
   background: #XXXXXX !important;
}


