css:
@-moz-document domain("youtube.com") {
/* Adapted from zoid's code */
.html5-play-progress,
.ytp-play-progress {
	background: url("data:image/gif;base64,") repeat-x !important;
}
.html5-load-progress,
.ytp-load-progress {
	background: url("data:image/gif;base64,") !important;
}
.html5-scrubber-button,
.ytp-scrubber-button {
	background: url("data:image/gif;base64,") !important;
	width: 50px !important;
	height: 35px !important;
	border: none !important;
	margin-left: -13px !important;
	margin-top: -20px !important;
	transform: scale(0.8);
	background-repeat: no-repeat;
	-webkit-transform: scale(0.8);
	-moz-transform: scale(0.8);
	-ms-transform: scale(0.8);
}
.ytp-progress-bar-container:hover .ytp-scrubber-button,
.ytp-progress-bar-container:hover .ytp-load-progress {
	image-rendering: auto;
}
.html5-progress-bar-container,
.ytp-progress-bar-container {
	height: 13px !important;
}
.html5-progress-bar,
.ytp-progress-bar {
	margin-top: 12px !important;
}
.html5-progress-list,
.ytp-progress-list,
.video-ads .html5-progress-list.html5-ad-progress-list,
.video-ads .ytp-progress-list.ytp-ad-progress-list {
	height: 13px !important;
}
.ytp-volume-slider-track {
	background:transparent !important;
}
}
